import React from 'react'
import AliceCarousel from 'react-alice-carousel';
import "react-alice-carousel/lib/alice-carousel.css";
import one from '../../pics/creative';
import two from '../../pics/creative2';
import three from '../../pics/em2';
import four from '../../pics/makeup';
import five from '../../pics/film';

const Carousel = () => {
    const carouselImgs = [
    { id: 1, src: one, title: 'one', description: 'first image', alt: ''  },
    { id: 2, src: two, title: 'two', description: 'second image', alt: ''  },
    { id: 3, src: three, title: 'three', description: 'third image', alt: ''  },
    { id: 4, src: four, title: 'four', description: 'fourth image', alt: '' },
    { id: 5, src: five, title: 'five', description: 'first image', alt: '' },
    ];

    return (
        <>
            <AliceCarousel>
                <carouselImgs classname="sliderimg">
                    <img src={carouselImgs} alt=''> </img> </carouselImgs>
            </AliceCarousel>
        </>
    )
}

export default Carousel
